import React, {useEffect, useState} from 'react';
import './App.css';

function App() {
  const [users, setUsers] = useState([])
  useEffect(() => {
    fetch("http://127.0.0.1:3000/users").then((response) => {
      return response.json()
    }).then((json) => {
      setUsers(json)
    })
  },[])
  return (
   <ul>

   </ul>
  );
}

export default App;
